import React from "react";

class Favourites extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            sampleData: "test",
        };
    }

    componentDidMount() {
        console.log('I mounted!');
    }
    
    render() {
        return(
          <div>
          <h1>Favourites Page</h1>
        </div>
        )
    }
}

export default Favourites;
